  return (
    <View
      style={{
        flex: 1,
      }}>

      <View style={{flex: 1, flexDirection: 'row'}}>
        <Image style={{height: 70, width: 70, margin: 10}}
        source={{uri: 'data:image/png;base64,'}}
        ></Image>
        <Text style={{fontSize: 16,fontWeight: 'bold'}}>USB Bluetooth Music Receiver HJX-001- Biến loa thường thành loa bluetooth</Text>

      </View>

    </View>
  );
};

